import React from 'react';
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import ReactDOM from 'react-dom';
import "bootstrap/dist/css/bootstrap.min.css"

import UsersList from './components/users-list.component'
import CreateUser from './components/create-user.component'
import Login from './components/log-in.component'
import Vendor from './Vendor'
import { Redirect } from "react-router-dom";


function App() {
  if(localStorage.getItem('type')==='Vendor'){
    ReactDOM.render( < Vendor/ > , document.getElementById('root'));
    return <Redirect to="/Vendor"/>
  }
  else{
    return (
    <Router>
        <div className="container" id="main">
          <nav className="navbar navbar-expand-lg navbar-light bg-light rounded">
            <Link to="/" className="navbar-brand ml-auto">App</Link>
            <div className="collapse navbar-collapse">
              <ul className="navbar-nav mr-auto">
                <li className="navbar-item">
                  <Link to="/" className="nav-link">Users</Link>
                </li>
                <li className="navbar-item">
                  <Link to="/create" className="nav-link .right">Create User</Link>
                </li>
                <li className="navbar-item">
                  <Link to="/log-in" className="nav-link">Log in</Link>
                </li>
              </ul>
            </div>
          </nav>

          <br/>
          <Route path="/" exact component={UsersList}/>
          <Route path="/create" component={CreateUser}/>
          <Route path="/log-in" component={Login}/>
          <Route path="/Vendor" component={Vendor}/>
        </div>
      </Router>
    );
  }
}

export default App;
